if ($('.home').find('.triptych').length) {
  $(window).on('load resize', function() {
    $('.home').find('.triptych').height('');
    if ($(window).width() >= 800) {
      $('.home').find('.triptych').equalHeights();
    } 
  });
}

$(window).load(function() {

    $(".fancybox").fancybox();
    $(".twitter-heading a").prepend("<i aria-hidden='true' data-icon='&#64258;'></i> ");
    $('.gallery').each(function() {
      var $items = $(this).find('a');
      $items.each(function() {
        $(this).attr('data-fancybox-group', $(this).attr("data-rel"));
      });
      $items.fancybox();
    });

    var $grid = $('.masonry').isotope({ itemSelector:'.masonry-item' });

    if ($('#og-grid').length) {
      function resetGridHeight() {
        var $items = $('#og-grid').find('li');
            $links = $items.find('.directory-link')
        ;
        $items.css({height:''});
        $links.css({height:''});

        $items.equalHeights();
        $links.equalHeights();
       }
      resetGridHeight();
      Grid.init();

      $(window).on( 'resize', function() {
        resetGridHeight();
      });
    }

    if ($('.research-filters').length) {
        var $research_filters = $('.research-themes li'),
            $research_filter_all = $('.research-themes li:first-child'),
            $research_results = $('.research-results'),
            $research_items   = $('.research-results .project-item'),
            $research_form    = $('#research-form')
        ;

        $research_form.on('submit', function() {
            var query = $('#research-query').val().toLowerCase();
            $research_results.isotope({ filter: function(){
                var copy = $(this).find('.project-item-copy').html().toLowerCase();
                return copy.indexOf(query) > -1;
            } });
            $('html, body').animate({
                scrollTop: ($research_results.offset().top - 32)
            }, 600);
            return false;
        });

        $research_results.isotope();

        $research_filter_all.addClass('active'); // Initialize filter list - NM

        $research_filters.click(function() {
            var filterValue = $(this).attr('data-theme');
            $research_filters.removeClass('active');
            $(this).addClass('active');
            $research_results.isotope({ filter: function(){
                var theme = $(this).attr('data-themes');
                return theme.indexOf(filterValue) > -1;
            } });
            $('#research-query').val('');
            $('html, body').animate({
                scrollTop: ($research_results.offset().top - 32)
            }, 600);
        });
    }
});